import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import logo from "./react-logo.png"; // I am using this img

function Page() {
  return (
    <div>
      <Header />
      <MainContent />
      <Footer />
    </div>
  );
}

function Header() {
  return (
    <header>
      <nav className="flex flex-row shadow-md">
        <img
          className="flex items-center basis-1/12 m-2 w-[60px]"
          src={logo}
          alt="React Logo"
        />
        <ul className="flex basis-11/12 justify-end items-center">
          <li className="m-2 text-xl">Priceing</li>
          <li className="m-2 text-xl">About</li>
          <li className="m-2 text-xl">Contact</li>
        </ul>
      </nav>
    </header>
  );
}

function Footer() {
  return (
    <footer className="absolute bottom-0 text-sm bg-slate-500 w-full">
      <p className="flex justify-end">
        @ 2021 Adrian development. All rights reserved.
      </p>
    </footer>
  );
}

function MainContent() {
  return (
    <div>
      <h1 className="text-4xl font-bold underline m-2">
        Fun facts about React:
      </h1>
      <ol className="list-disc list-inside text-2xl m-2">
        <li>Was first released in 2013</li>
        <li>Was originally created by Jordan Walke</li>
        <li>Has well over 100k stars on GitHub</li>
        <li>Is maintained by Facebook</li>
        <li>Powers thousands of enterprise apps, including mobile apps</li>
      </ol>
    </div>
  );
}

ReactDOM.render(<Page />, document.getElementById("root"));
